import {Link} from 'react-router-dom'
import { AiOutlineShoppingCart,AiOutlineHome } from "react-icons/ai";
import { GiPlanetConquest } from "react-icons/gi";



const Header = (props) => {
  let num = 0
  if (props.totalQuantity === 0){
    num = ''
  }
  else{
    num = `(${props.totalQuantity})`
  }

    return (
      
      <div className='header'>
        <div className='title'>Lunar Land Retail</div>
        <div className='links'>
          
            <Link to='/' className='text-link'>Home <AiOutlineHome className='cartIcon'/> </Link>
            <Link to="/shop" className='text-link'>Shop <GiPlanetConquest className='cartIcon'/></Link>
            <Link to="/cart" className='text-link'>Cart <AiOutlineShoppingCart className='shopIcon'/>{num} </Link>
         
          </div>
         
      </div>
    );
  }
  export default Header;
